</div></div></div><div id="wb_element_instance5_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-horizontal"><div id="wb_element_instance6_1" class="wb_element wb_element_picture wb-anim-entry wb-anim-zoom-in-none" data-plugin="Picture" data-wb-anim-entry-time="1.4" title=""><div class="wb_picture_wrap"><a href="https://yuyuzer.lw601.usbx.me/jellyfin/"><img alt="" src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/47737b7e-a708-4a0b-bfa8-3e7edd1745a4/d3kgcoa-fd810e33-8caa-4f45-8777-b2f3548391ec.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..gNfjVPqMnnIS3Y2lT87rX-w3lMmy664Ech_tomKHbhQ"></a></div></div><div id="wb_element_instance7_1" class="wb_element wb_text_element wb-anim-entry wb-anim-fade-in-none" data-plugin="TextArea" data-wb-anim-entry-time="1.8" style=" line-height: normal;"><h2 class="wb-stl-custom1" data-dnid="144">ようこそ</h2>

<p class="wb-stl-custom2" data-dnid="146">Welcome to the personal website of yuyu, the 69 bg</p>
</div><div id="wb_element_instance8_1" class="wb_element wb_text_element" data-plugin="TextArea" style=" line-height: normal;"><p class="wb-stl-custom2" data-dnid="135" data-ignore-in-html="1"></p></div></div></div><div id="wb_element_instance9_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-horizontal"><div id="wb_element_instance10_1" class="wb_element wb_text_element wb-anim-entry wb-anim-fade-in-none" data-plugin="TextArea" data-wb-anim-entry-time="1.2" style=" line-height: normal;"><p class="wb-stl-custom3" data-dnid="148">yuyu étudiant en droit (pour le moment), j'aime la mode, la musique classique mais avant tout l'art. Je joue un peu et regarde quelques animés de temps en temps même si je passe le plus clair de mon temps à écouter et composer de la musique.</p>

<p class="wb-stl-custom3" data-dnid="148"> </p>

<p class="wb-stl-custom3" data-dnid="150">Je sais plus trop quoi écrire pour le moment, donc le temps que je trouve, voici un texte intéressant :</p>

<p class="wb-stl-custom3" data-dnid="152"> </p>

<p class="wb-stl-custom3" data-dnid="154">L'art doit avant tout embellir la vie, donc nous rendre nous-mêmes tolérables aux autres et agréables si possible : ayant cette tâche en vue, il modère et nous tient en bride, crée des formes de civilité, lie ceux dont l'éducation n'est pas faite à des lois de convenance, de propreté, de politesse, leur apprend à parler et à se taire au bon moment.</p>

<p class="wb-stl-custom3" data-dnid="156">De plus, l'art doit dissimuler ou réinterpréter tout ce qui est laid, ces choses pénibles, épouvantables et dégoûtantesqui malgré tous les efforts, à cause des origines de la nature humaine, viendront toujours de nouveau à la surface : Il doit agir ainsi surtout pour ce qui est des passions, des douleurs de l'âme et des craintes, et faire transparaître, dans la laideur inévitable ou insurmontable, son côté significatif.</p>

<p class="wb-stl-custom3" data-dnid="158">Après cette tâche de l'art, dont la grandeur va jusqu'à l'énormité, l'art que l'on appellevéritable, l'art des oeuvres d'art n'est qu'accessoire. L'homme qui sent en lui un excédent de ses forces qui embellissent, cachent, transforment, finira par chercher à s'alléger de cet excédent par l'oeuvre d'art ; dans certaines circonstances, c'est tout un peuple qui agira ainsi.</p>

<p class="wb-stl-custom3" data-dnid="160"> </p>

<p class="wb-stl-custom3" data-dnid="162">Mais on a l'habitude, aujourd'hui, de commencer l'art par la fin : on se suspend à sa queue, avec l'idée que l'art des oeuvres d'art est le principal et que c'est en partant de cet art que la vie doit être améliorée et transformée. Fous que nous sommes! Si nous commençons le repas par le dessert, goûtant à un plat sucré après l'autre, quoi d'étonnant si nous nous gâtons l'estomac et même l'appétit pour le bon festin, fortifiant et nourrissant, à quoi l'art nous convie ?</p>

<p class="wb-stl-custom3" data-dnid="164"> </p>

<p class="wb-stl-custom3" data-dnid="166">Nietzsche</p>
</div></div></div></div></div><div id="wb_main_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-vertical"><div id="wb_element_instance11_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-horizontal"><div id="wb_element_instance12_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-vertical"><div id="wb_element_instance13_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-horizontal"></div></div><div id="wb_element_instance14_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-horizontal"><div id="wb_element_instance15_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-horizontal"><div id="wb_element_instance16_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-vertical"><div id="wb_element_instance17_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-horizontal"><div id="wb_element_instance18_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb-layout-bg-element"><div id="wb_element_instance19_1" class="wb_element wb_element_shape" data-plugin="Shape"><div class="wb_shp"></div></div></div><div class="wb_content wb-layout-vertical"><div id="wb_element_instance20_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-horizontal"><div id="wb_element_instance21_1" class="wb_element wb-layout-element" data-plugin="LayoutElement"><div class="wb_content wb-layout-vertical"><div id="wb_element_instance22_1" class="wb_element wb_text_element" data-plugin="TextArea" style=" line-height: normal;"><p class="wb-stl-custom4" data-dnid="313">Anilist : </p>

